function signIn() {

    return (
        <form onSubmit={()=>alert('Submitted')}>
            <div class="form-group row">
                <label> E-Mail: </label>
                <div class="col-sm-10">
                    <input type="email" />
                </div>
            </div>

            <div class="form-group row">
                <label> Password: </label>
                <div class="col-sm-10">
                    <input type="password" />
                </div>
            </div>

            <div class="form-group row">
                <div class="col-sm-10">
                    < button type="submit" class="btn btn-primary" onClick={()=>alert('submit button')} > Se Connecter</ button >
                </div>
            </div>

            <div class="form-group row">
                <div class="col-sm-10">
                    < button type="danger" class="btn btn-secondary" onClick={()=>alert('password button')} > Mdp oubli√© ? </ button >
                </div>
            </div>

        </form >
    );
}
export default signIn;
